// Libraries import
import React from "react";

// css import
import './comment.css'

// function Component
function Comment(){
    // Return JSX element
    return(
        <>
            <section className="comment">
                <p>Título</p>
                <p>Texto do comentário</p>
                <p>Autor X</p>
            </section>
        </>
    );

}

export default Comment;
